import React, { useEffect, useState } from "react";
import { Paper,TableContainer,Table,TableHead,TableRow,TableCell,TableBody, TablePagination } from "@material-ui/core";

import useStyle from "./styles";


  const columns = [
    { id: 'id', label: 'CEV ID', minWidth: 170 },
    { id: 'date', label: 'PUBLISHED DATE', minWidth: 170 },
    { id: 'severity', label: 'SEVERITY', minWidth: 170,},
    { id: 'desc', label: 'DESCRPTION', minWidth: 170,},
  ];



  const Dashboard = () => {
  const [tableData, setTableData ] = useState([]);
  const classes = useStyle();


  useEffect(() => {
    fetch('http://localhost:5000/data')
    .then(response => response.json())
    .then(data => setTableData);
  },[])


  return (
    <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow> {columns.map((column) =>(
            <TableCell key={column.id} align='left' style={{ minWidth: column.minWidth }}>
            {column.label}
            </TableCell>))}
            </TableRow>
          </TableHead>
          <TableBody>
            <TableRow>

            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default Dashboard;
